(1, 'Online Shop', 'Web and Mobile Online Store Application', 'gomocart@gmail.com', NULL, NULL, '0822 4442 5880', '0822 4442 5880', 'Jl. Puncak Sekuning No 520, 26 Ilir D. I, Ilir Bar. I, Kota Palembang, Sumatera Selatan 30128', 33, 'Sumatera Selatan', 327, 'Palembang', '30128', 104.737325, -2.984773, '<p><span style=\"font-weight: bold;\"><a href=\"#\">Gomocart</a> adalah....</span></p>', NULL, '<p>Blibli.com, Toko Online Terlengkap &amp; Terpercaya Dengan Beragam Produk Pilihan Serta Promo Menarik<br><br>Sebagai pelopor mall online<br>terbesar &amp; terlengkap di Indonesia, Blibli.com yang memiliki slogan<br>?Big Choices, Big Deals? hadir dengan beragam kategori pilihan untuk<br>memenuhi kebutuhan keseharian Anda, mulai dari kebutuhan lifestyle, otomotif, hobi &amp; olahraga, dan kebutuhan rumah tangga. Bagi Anda yang memiliki hobi memperbarui&nbsp; lifestyle gaya hidup Anda, Toko Online Blibli.com bisa memenuhi kebutuhan Anda denga menghadirkan berbagai smartphone terbaru dan terpopuler di kategori handphone &amp; gadget. Selain itu, Online Shop Blibli.com juga menghadirkan kategori fashion pria &amp; wanita untuk memberikan pilihan produk fashion kekinian.<br><br><br><br>Untuk Anda yang tak mau repot belanja produk-produk otomotif, Toko Online<br>Blibli.com membantu Anda untuk memiliki produk otomotif secara mudah<br>dengan jual produk otomotif terlengkap, mulai dari produk &amp;<br>aksesoris sepeda, sepeda motor, dan mobil. Berbagai produk rumah tangga<br>juga hadir di Online Shop Blibli.com, mulai dari produk bumbu-bumbu dapur, elektronik rumah tangga, dan&nbsp; perabotan atau furnitur rumah tangga. Ayo belanja online kebutuhan sehari-hari Anda di online shop dengan kategori terlengkap. Temukan ?Big Choices? Anda dengan jelajahi ribuan kategori dengan produk-produk pilihan di online shop terbesar di Indonesia, Blibli.com!<br><br><br><br>Belanja Online dengan Promo Spesial Setiap Hari<br><br>Toko Online Blibli.com memberikan Anda kemudahan dalam belanja online dengan menghadirkan promo spesial dengan harga promo menarik. Harga promo<br>termurah atau ?Big Deals? terbesar di Indonesia hadir di Promo Monday<br>Mom?s Day, Promo Rabu Cantik, Promo Kamis Ganteng, Promo Fun Week End<br>Deals, Promo Gajian Big Pay Day, dan Promo Hot Deals. Nikmati berbagai<br>promo belanja online kebutuhan Ibu &amp; Anak di promo Monday Mom?s Day setiap hari Senin mulai Pukul 00.00-23.59 WIB di Toko Online Blibli.com.<br><br>Promo spesial bagi para Wanita yang ingin memperbarui gaya fashion-nya<br>juga hadir di Promo Rabu Cantik, setiap hari Rabu Pukul 00.00-23.59<br>WIB. Anda bisa pantau Promo Kamis Ganteng yang hadir pada hari Kamis,<br>Pukul 10.00-15.00 WIB, untuk mendapatkan promo Flash Sale dengan harga<br>produk termurah. Setiap weekend, Anda juga masih bisa menikmati<br>produk gadget termurah dengan Promo Fun Weekend Deal, dari hari<br>Jumat-Minggu. Harga promo produk termurah juga hadir di promo gajian Big<br>Pay Day dan Promo Hot Deals. Selain promo di atas, masih banyak lagi<br>promo produk/brand terbaik lainnya di online shop dengan promo produk terlengkap, Toko Online Blibli.com!<br><br><br><br>Toko Online dengan Kualitas Produk Terjamin dan Original<br><br>Selain sebagai toko online dengan produk dan promo terlengkap, Blibli.com juga menjamin para customer-nya untuk mendapatkan keuntungan belanja online lainnya, yakni produk original dengan kualitas terjamin. Berbagai produk yang hadir di Toko Online Blibli.com berasal dari brand, store, dan merchant terpercaya sehingga kualitasnya benar-benar terjamin. Beberapa brand terpercaya<br>tersebut antara lain NBA Store, Nike, Intel Store, Unilever, Samsung,<br>Musica Trinity, Adidas, dan Local Genius. Seluruh produk yang tersedia<br>di toko online ini merupakan produk original. Untuk berbagai produk dalam kategori tertentu, tersedia pula garansi produk.<br><br><br><br>Belanja Online dengan Beragam Cara Pembayaran dan Gratis Pengiriman di Toko Online Blibli.com<br><br><br><br>Pembayaran dalam belanja online di Blibli.com bisa<br>Anda lakukan dengan cara yang mudah. Kemudahan tersebut bisa Anda<br>rasakan melalui beragam cara pembayaran yang tersedia di Toko Online Blibli.com, seperti pembayaran melalui bayar di tempat (Cash On Delivery/COD), internet banking,<br>transfer melalui ATM, pembayaran uang elektronik, dan pembayaran<br>melalui store (Indomaret &amp; Pos Indonesia). Selain itu, Anda juga<br>bisa belanja di Online Shop Blibli.com dengan fasilitas<br>cicilan 0% dengan tenor 6 hingga 12 bulan melalui pembayaran kartu<br>kredit. Dengan beragam cara pembayaran tersebut, tentu Anda semakin<br>mudah dalam belanja online di Blibli.com.<br><br><br><br>Online Shop Indonesia Paling Aman &amp; Terpercaya<br><br><br><br>Proses pembayaran dalam berbelanja di Toko Online Blibli.com sangat aman dan terpercaya. Untuk mendukung Anda agar nyaman dalam belanja di Online Shop<br>Blibli.com, sistem keamanan pembayaran Blibli.com sudah bersertifikasi<br>oleh Verisign, Verified by Visa, MasterCard SecureCode, dan Credit Card<br>Fraud Detection System. Selain itu, jika Anda memiliki kendala dalam belanja online di Blibli.com, Anda bisa hubungi kami melalui Customer Care (telepon, email, dan live chat) yang online 24 jam untuk membantu Anda.</p>', '', '', '', '', '', '', '', '', '', '', '', '3724.png', '6798.png', '4326.png', 1, 0, 1, 1, 0, 0, 0, '1', '1.0.0', 'Tes\r\n1. satu\r\n2. dua\r\n3. tiga', 0, 0, 0, 0, 5, '08:00 s/d 17:00', 'kiezie08', '@kiezie08', '@kiezie');
